                          en: cc11001100_hook("en", 'Enjoy one free change for tickets issued on or before 31 December 2022. Travel must be completed by 31 December 2023.<br/><br/>A flight change fee of USD50 or 7,500 Asia Miles will be charged for any additional changes and for tickets issued on or after 1 January 2023*.<br/><br/><span style="font-size: 12px;">* Flight change fee will apply per flight ticket, per passenger within the same itinerary, for Cathay Pacific-operated flights and same ticket expiry date</span>', "object-key-init"),
                          tw: cc11001100_hook("tw", '於 2022 年 12 月 31 日或之前發出的機票可享一次免費更改優惠。行程必須於 2023 年 12 月 31 日前完成。<br/><br/>對於任何額外更改及於 2023 年 1 月 1 日或之後發出的機票，將收取航班更改手續費 50 美元或 7,500「亞洲萬里通」里數*。<br/><br/><span style="font-size: 12px;">* 如屬國泰航空營運航班及同一機票有效日期，須就同一行程內每位乘客每張航班機票支付航班更改手續費</span>', "object-key-init"),
